[[package]]
name = "attrs"
version = "21.2.0"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*"
summary = "Classes Without Boilerplate"

[[package]]
name = "bindepend"
version = "0.1"
summary = "Binary depedency analysis"
dependencies = [
    "pefile",
]

[[package]]
name = "delocate"
version = "0.10.0"
requires_python = ">=3.6"
summary = "Move macOS dynamic libraries into package"
dependencies = [
    "bindepend; sys_platform == \"win32\"",
    "machomachomangler; sys_platform == \"win32\"",
    "typing-extensions",
    "wheel",
]

[[package]]
name = "future"
version = "0.18.2"
requires_python = ">=2.6, !=3.0.*, !=3.1.*, !=3.2.*"
summary = "Clean single-source support for Python 3 and 2"

[[package]]
name = "machomachomangler"
version = "0.0.1"
summary = "Tools for mangling Mach-O and PE binaries"
dependencies = [
    "attrs",
]

[[package]]
name = "pefile"
version = "2021.9.3"
requires_python = ">=3.6.0"
summary = "Python PE parsing module"
dependencies = [
    "future",
]

[[package]]
name = "typing-extensions"
version = "3.10.0.2"
summary = "Backported and Experimental Type Hints for Python 3.5+"

[[package]]
name = "wheel"
version = "0.37.0"
requires_python = "!=3.0.*,!=3.1.*,!=3.2.*,!=3.3.*,!=3.4.*,>=2.7"
summary = "A built-package format for Python"

